package fundamentals;

public class IncrementDecrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=60,b =80;
		if(a++>60&&b++>80) {
			System.out.println("If part");
		}else {
			System.out.println("else part");
		}
		System.out.println("a "+a+", b "+b);
	    

	}
}

